import React, { Component } from 'react'

export class Card extends Component {
    render() {
        return (
            <div className='card'>
                <img src={"./img/" + this.props.card.img}></img>
                <h2>{this.props.card.title}</h2>
                <p>{this.props.card.desc}</p>
                <div className='add-to-favorite'>+</div>
            </div>
        )
    }
}

export default Card
